import React from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import AdminSide from './AdminSide/AdminSide'
import Portal from './ClientSide/Portal'
import SinglePost from './AdminSide/SinglePost'

function App() {
  return (
    <div className="App">
      <Router>
        <div>
          <Switch>
            <Route path="/admin">
              <AdminSide />
            </Route>
            <Route path="/">
              <Portal />
            </Route>
            <Route path="/admin/:id" children={<SinglePost />} />
          </Switch>
        </div>
      </Router>
    </div>
  );
}

export default App;
